The graphql api endpoint is located at `https://api.example.com/graphql`. The mutation that you need to execute is:

```graphql
mutation CreateContact($input: CreateContactInput!) {
  createContact(input: $input) {
    id
    name
    email
    phone
    address
    city
    state
    zip
  }
}
```

The input variable is a list of objects with the same structure as the form data. The output of the mutation is an object with the same structure as the input, but with an additional `id` field.

You will need to use the `fetch` function to make the request to the graphql api. You will also need to use the `JSON.stringify` function to convert the form data into a string that can be sent in the request body.

Here is an example of how you might implement the on submit function:

```javascript
function onSubmit(event) {
  event.preventDefault();

  const formData = new FormData(event.target);
  const data = {};
  formData.forEach((value, key) => {
    data[key] = value;
  });

  const input = {
    name: data.name,
    email: data.email,
    phone: data.phone,
    address: data.address,
    city: data.city,
    state: data.state,
    zip: data.zip
  };

  const variables = {
    input: input
  };

  fetch("https://api.example.com/graphql", {
    method: "POST",
    headers: {
      "Content-Type": "application/json"
    },
    body: JSON.stringify({
      query: mutation,
      variables: variables
    })
  })
    .then(response => response.json())
    .then(data => {
      console.log(data);
    })
    .catch(error => {
      console.error(error);
    });
}
```

